import { RETURNING_ITEMS } from '../Actions/types';

const initialState = [];

const activeReturn = (state = initialState, { type, payload }) => {
  switch (type) {
    case RETURNING_ITEMS:
      return { ...state, payload };
    default:
      return state;
  }
};

export default activeReturn;
